A .net toaster library for very simple and slightly customizable toaster notifications

Usage:
ErrorToaster.Toast("My Error Message!");
SuccessToaster.Toast("Success message");
WarningToaster.Toast("Warning message", "bottomright");

You can optionally choose to display the toast in the bottom right by added the parameter "bottomright", more positions and animations to come.

A .net toaster library for very simple and slightly customizable WPF toaster notifications

Check it out on github: https://github.com/zachatrocity/netoaster

Usage:
var err = new ErrorToaster(MessageText.Text);
err.Show();

//or

var suc = new SuccessToaster(MessageText.Text, "bottomright");
suc.Show();

//or

var warn = new WarningToaster("bottomright");
warn.Show();

public override void ViewDidLoad()
{
    base.ViewDidLoad();

    var btn1 = new UIButton()
    {
		BackgroundColor = new UIColor(0,0,255,255),
        Frame = new CoreGraphics.CGRect(50, 50, 200, 100)
    };
	btn1.SetTitle ("Order", UIControlState.Normal);
    btn1.TouchUpInside += (sender, e) =>
    {
        var orderStr = OrderHelper.OrderStr("id", "id", "20150525-000001",
            "Xamarin中文书", "Visual C#与Xamarin跨平台行动App开发实战",
            "0.01",
            "http://notify.java.jpxx.org/index.jsp"
        );
        var PrivateKey = "PrivateKey";
        var schemeStr = OrderHelper.SchemeStr(orderStr, PrivateKey);
        AlipaySDK.DefaultService().PayOrder(orderStr, schemeStr, completionBlock);
    };
    this.View.AddSubview(btn1);
}
Action<NSDictionary> completionBlock = new Action<NSDictionary>((result) =>
{
    new UIAlertView("title", result.ToString(), null, "ok", null).Show();
});
